import React from "react";
import { useDispatch, useSelector } from "react-redux";
import { getBreeds } from "../../Redux/Actions";
function Home() {
  const dispatch = useDispatch();
  const breeds = useSelector(state => state.breedsLoaded);
  React.useEffect(() => {
    dispatch(getBreeds());
  }, [dispatch]);
  return (
    <div>
      <h1>{breeds.len} </h1>
      {/* { breeds?.map(e => (
        <h1> {e.name}</h1>
      ))} */}
    </div>
  );
}
export default Home;
